# Importando as bibliotecas necessárias...
import json
import pandas as pd
import matplotlib.pyplot as plt
import seaborn as sns
from google.colab import files

# Lendo o arquivo json
source = pd.read_json("https://api.github.com/search/repositories?q=language:python&sort=starts")

# Observando a quantidade de estrelas dadas a cada repositório ou projeto escrito somente em Python = popularidade...
# NOTA: A popularidade (stargazers_count) vai mudando em real-time, de acordo às estrelas recebidas por cada repositório
fields = ["id", "stargazers_count"]
df = pd.json_normalize(source["items"])
df.head()[fields]

# Criando uma primeira função para o Gráfico que mostra os 6 respositórios mais populares que usam Python como linguagem nos seus códigos......

def barplot(y):
  
  # Ordenando os respositórios de maior a menor popularidade...
  popularidade_ordenada = df["id"]
  popularidade_ordenada.sort_index()
  
  # Definindo os parâmetros do gráfico...
  sns.set(style = "darkgrid")
  chart = sns.barplot(x = "id", y = y, data = df, order = popularidade_ordenada)
  chart.set_xticklabels(chart.get_xticklabels(), rotation=45)
  
  # Salvando o gráfico em formato png com 300 dpi...
  plt.savefig("popularidade_repos_python.png", dpi = 300, bbox_inches = 'tight')
  files.download("popularidade_repos_python.png")

  # Salvando o gráfico em formato svg...
  plt.savefig("popularidade_repos_python.svg")
  files.download("popularidade_repos_python.svg")

# Plotando e mostrando o gráfico de barras contendo os respositórios que usam Python como linguagem nos seus códigos...
plt.figure(figsize = (20,8))
barplot(y = "stargazers_count")
plt.title("Gráfico de barras da popularidade dos repositórios que usam a linguagem Python nos seus códigos depositados no GitHub")
plt.ylabel("Quantidade de estrelas recebidas por cada ID")
plt.xlabel("ID de cada repositório")
plt.show()

"""**NOTA:**

Para saber mais sobre a diferença entre os formatos png e svg, leitura recomendada:
[Diferença entre png e svg](https://www.pagecloud.com/blog/web-images-png-vs-jpg-vs-gif-vs-svg)
"""

# Criando um dataframe com os primeiros 6 repositórios mais populares...
df2 = df.head(6)
df2[fields]

# Criando uma segunda função para o Gráfico que mostra os 6 respositórios mais populares que usam Python como linguagem nos seus códigos......

def barplot2(y):
  
  # Ordenando os respositórios de maior a menor popularidade...
  popularidade_ordenada = df2["id"]
  popularidade_ordenada.sort_index()
  
  # Definindo os parâmetros do gráfico...
  sns.set(style = "darkgrid")
  chart = sns.barplot(x = "id", y = "stargazers_count", data = df2, order = popularidade_ordenada)
  chart.set_xticklabels(chart.get_xticklabels(), rotation=45)
  
  # Salvando o gráfico em formato png com 300 dpi...
  plt.savefig("6_primeiros_repos_python.png", dpi = 300, bbox_inches = 'tight')
  files.download("6_primeiros_repos_python.png")
  
  # Salvando o gráfico em formato svg...
  plt.savefig("6_primeiros_repos_python.svg")
  files.download("6_primeiros_repos_python.svg")

# Plotando e mostrando o gráfico de barras contendo os 6 respositórios mais populares que usam Python como linguagem nos seus códigos...
plt.figure(figsize = (10,6))
barplot2(y = "stargazers_count")
plt.title("Gráfico de barras dos primeiros 6 repositórios mais populares que usam a linguagem Python nos seus códigos depositados no GitHub")
plt.ylabel("Estrelas recebidas pelos 6 repositórios mais populares")
plt.xlabel("ID dos primeiros 6 repositórios")
plt.show()

"""# **DESAFIO 2:**

Criando uma busca por projetos Python e HTML depositados no GitHub com uma saída de arquivo CSV e inserido-o num repositório...

![Screen Shot 2020-10-29 at 10.16.41.png](data:image/png;base64,)

**NOTA:**

Primeiramente fiz uma busca por projetos escritos em Python e/ou em HTML e depositados no GitHub. Para isto, criei uma URL contendo tais informações...

Referência: 

[Search Repositories](https://developer.github.com/v3/search/#search-repositories)
"""

# Lendo o primeiro arquivo json contendo os projetos escritos somente em Python e depositados no GitHub...
source_1 = pd.read_json("https://api.github.com/search/repositories?q=language:python&sort=starts")
df_1 = pd.json_normalize(source_1["items"])

# Importando as librarias necessárias para a criação dos arquivos CSV para download...
from IPython.display import HTML
import base64  

# Criando a função para fazer o do arquivo CSV contendo apenas os repos escritos unicamente em Python...
def create_download_link (source_1, title = "Download_CSV_file1", filename = "data_repo_python.csv"):  
    csv = df_1.to_csv(index = False)
    b64 = base64.b64encode(csv.encode())
    payload = b64.decode()
    html = '<a download="{filename}" href="data:text/csv;base64,{payload}" target="_blank">{title}</a>'
    html = html.format(payload = payload, title = title, filename = filename)
    return HTML(html)

create_download_link(source_1)

# Lendo o segundo arquivo json contendo os projetos escritos somente em HTML e depositados no GitHub...
source_2 = pd.read_json("https://api.github.com/search/repositories?q=language:html")
df_2 = pd.json_normalize(source_2["items"])

# Criando a função para fazer o download do arquivo CSV contendo apenas os repos escritos unicamente em HTML...
def create_download_link (source_2, title = "Download_CSV_file2", filename = "data_repo_html.csv"):  
    csv = df_2.to_csv(index = False)
    b64 = base64.b64encode(csv.encode())
    payload = b64.decode()
    html = '<a download="{filename}" href="data:text/csv;base64,{payload}" target="_blank">{title}</a>'
    html = html.format(payload = payload, title = title, filename = filename)
    return HTML(html)

create_download_link(source_2)

# Lendo o terceiro arquivo json contendo os projetos escritos tanto em Python quanto em HTML e depositados no GitHub...
source_3 = pd.read_json("https://api.github.com/search/repositories?q=language:html+language:python")
df_3 = pd.json_normalize(source_3["items"])

# Criando a função para fazer o download do arquivo CSV contendo os repos escritos tanto em Python quanto em HTML...
def create_download_link (source_3, title = "Download_CSV_file3", filename = "data_repo_python_html.csv"):  
    csv = df_3.to_csv (index = False)
    b64 = base64.b64encode (csv.encode())
    payload = b64.decode()
    html = '<a download="{filename}" href="data:text/csv;base64,{payload}" target="_blank">{title}</a>'
    html = html.format(payload = payload, title = title, filename = filename)
    return HTML(html)

create_download_link(source_3)